// Bardzo prosty kod React â€“ styl: "staÅ¼ysta z YouTube"

import React, { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [tasks, setTasks] = useState([]);
  const [title, setTitle] = useState('');
  const [description, setDescription] = useState('');
  const [filter, setFilter] = useState('all');

  useEffect(() => {
    getTasks();
  }, []);

  function getTasks() {
    axios.get('http://localhost:8080/api/tasks')
      .then(res => setTasks(res.data))
      .catch(err => console.log(err));
  }

  function addTask() {
    if (!title) return;
    axios.post('http://localhost:8080/api/tasks', {
      title: title,
      description: description
    })
    .then(() => {
      setTitle('');
      setDescription('');
      getTasks();
    });
  }

  function deleteTask(id) {
    axios.delete(`http://localhost:8080/api/tasks/${id}`)
      .then(() => getTasks());
  }

  function toggleTask(id) {
    axios.patch(`http://localhost:8080/api/tasks/${id}/toggle`)
      .then(() => getTasks());
  }

  function clearDone() {
    const doneTasks = tasks.filter(t => t.done);
    doneTasks.forEach(t => {
      axios.delete(`http://localhost:8080/api/tasks/${t.id}`)
        .then(() => getTasks());
    });
  }

  const filteredTasks = tasks.filter(task => {
    if (filter === 'done') return task.done;
    if (filter === 'notdone') return !task.done;
    return true;
  });

  return (
    <div style={{ maxWidth: '600px', margin: '0 auto', padding: '20px' }}>
      <h1>To-Do App</h1>

      <div>
        <button onClick={addTask}>Dodaj nowe zadanie</button>
        <button onClick={clearDone}>WyczyÅ›Ä‡ wykonane</button>
      </div>

      <div style={{ marginTop: '10px' }}>
        <span>Filtr: </span>
        <button onClick={() => setFilter('all')}>Wszystkie</button>
        <button onClick={() => setFilter('done')}>âœ” Wykonane</button>
        <button onClick={() => setFilter('notdone')}>âœ˜ Niewykonane</button>
      </div>

      <div style={{ marginTop: '20px' }}>
        {filteredTasks.map(task => (
          <div key={task.id} style={{ border: '1px solid #ccc', padding: '10px', marginBottom: '10px' }}>
            <h3>{task.done ? 'âœ…' : 'ðŸŸ¦'} {task.title}</h3>
            <p>Opis: {task.description}</p>
            <button onClick={() => toggleTask(task.id)}>
              {task.done ? 'âœ˜ Oznacz jako niewykonane' : 'âœ” Oznacz jako wykonane'}
            </button>
            <button onClick={() => deleteTask(task.id)}>ðŸ—‘ UsuÅ„</button>
          </div>
        ))}
      </div>

      <div style={{ marginTop: '30px' }}>
        <h2>âž• Dodaj nowe zadanie</h2>
        <div>
          <label>TytuÅ‚: </label>
          <input value={title} onChange={(e) => setTitle(e.target.value)} />
        </div>
        <div>
          <label>Opis: </label>
          <input value={description} onChange={(e) => setDescription(e.target.value)} />
        </div>
        <button onClick={addTask}>Dodaj zadanie</button>
      </div>
    </div>
  );
}

export default App;
